measurements.description:
Sixty-two flat flowers and 42 buds on seven up to 26-cm inflorescences;
 sepals and petals white, marked dark red proximally, blushed dark pink distally,
  sepals broadly ovate, petals ovate-spatulate;
 lip saccate, cream, orange markings, side lobes red; column white, anther cap white;
 substance firm; texture slightly crystalline.
